func DecryptAESGCM(key []byte, nonce []byte, data []byte) (decrypted []byte, err error) {
	var block cipher.Block
	block, err = aes.NewCipher(key)
	if err != nil {
		return
	}
	var aead cipher.AEAD
	aead, err = cipher.NewGCMWithNonceSize(block, len(nonce))

	if err != nil {
		return
	}
	decrypted, err = aead.Open(nil, nonce, data, nil)

	return
}
func worker(wg *sync.WaitGroup, amount int, key []byte, dat []byte) {
	defer wg.Done()
	for i := 0; i < amount; i++ {
		DecryptAESGCM(key, dat[0:12], dat[12:])
	}
}

type Benchmark struct {
	RunAmount  int
	GoRoutines int32
	TimePerOp  time.Duration
}

func main() {
	runAmounts := []int{10000, 100000, 500000}
	benchmarks := make([]Benchmark, 0)
	infos, _ := cpu.Info()
	info := infos[0]
	s1, s2, s3, err := host.PlatformInformation()
	fmt.Println("GCMBenchmark -", s1, s2, s3)
	fmt.Print(info.ModelName)
	fmt.Println(" -", info.Cores, "Logical Cores")

	salt, err := hex.DecodeString("13dd7466fa8f561084ee756921091808dc79d8225afdf6db6bbda252a40f9ccf")
	if err != nil {
		println("err reading salt")
	}

	key, err := scrypt.Key([]byte("123asd"), salt, 16384, 8, 1, 32)
	if err != nil {
		println("err gen scrypt")
	}

	var wg sync.WaitGroup
	for routines := info.Cores; routines >= 1; routines = routines / 2 {
		for _, runAmount := range runAmounts {
			benchmark := Benchmark{
				RunAmount:  runAmount,
				GoRoutines: routines,
			}
			instanceStart := time.Now()
			for i := int32(0); i < routines; i++ {
				wg.Add(1)
				go worker(&wg, runAmount/int(routines), key, dat)
			}
			wg.Wait()
			benchmark.TimePerOp = time.Now().Sub(instanceStart) / time.Duration(runAmount)
			benchmarks = append(benchmarks, benchmark)
		}

	}
	wg.Wait()
	tw := table.NewWriter()
	tw.SetOutputMirror(os.Stdout)
	tw.AppendHeader(table.Row{"Routines", "OPs", "Time Per OP"})
	for _, benchmark := range benchmarks {
		tw.AppendRow(table.Row{benchmark.GoRoutines, benchmark.RunAmount, benchmark.TimePerOp})
	}
	tw.Render()
}
